--
-- Structure for view `view_adddition_reg`
--
DROP TABLE IF EXISTS `view_adddition_reg`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_adddition_reg`  AS  select ucase(concat(`d`.`lname`,',',`d`.`fname`,' ',`d`.`mname`)) AS `full_name`,`a`.`register_number` AS `register_number`,`a`.`company_id` AS `company_id`,`a`.`amount` AS `amount`,`a`.`term_number` AS `term_number`,`b`.`remaining_balance` AS `total_balance`,`b`.`addition_name` AS `addition_name`,`b`.`validity` AS `payment_term` from ((`payroll_register_additions` `a` join `addition_tables` `b` on((`a`.`addition_id` = `b`.`id`))) left join `hris_csi`.`personal_information` `d` on((`a`.`company_id` = `d`.`company_id`))) where ((`a`.`status` = 'RELEASED') or (`a`.`status` = 'COMPUTE')) ;

