--
-- Structure for view `view_checkifgroup_belongto_register`
--
DROP TABLE IF EXISTS `view_checkifgroup_belongto_register`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_checkifgroup_belongto_register`  AS  select `d`.`register_number` AS `register_number`,`a`.`emp_no` AS `emp_no`,ucase(concat(`a`.`lname`,',',`a`.`fname`,' ',`a`.`mname`)) AS `full_name`,`a`.`company_id` AS `company_id`,`b`.`company_ind` AS `company_ind`,`f`.`company_name` AS `company_name`,`e`.`type` AS `type`,`e`.`flexihrs` AS `flexihrs`,`c`.`payroll_group_ind` AS `payroll_group_ind` from (((((`hris_csi`.`personal_information` `a` left join `hris_csi`.`employee_information` `b` on((`a`.`company_id` = `b`.`company_id`))) left join `hris_csi`.`employee_payroll_group` `c` on((`a`.`company_id` = `c`.`company_id`))) left join `payroll_register_group` `d` on((`c`.`payroll_group_ind` = `d`.`group_ind`))) left join `hris_csi`.`group_schedule` `e` on((`c`.`payroll_group_ind` = `e`.`group_ind`))) left join `hris_csi`.`company` `f` on((`b`.`company_ind` = `f`.`id`))) where ((`a`.`active` = 'yes') and (`c`.`deleted` = 0) and (`d`.`deleted` = 0)) order by `d`.`register_number` ;

